import React from 'react';
import './tools.css';
import logo1 from './logo1.jpg'

function Tools() {
    return (
        <div className="toolcontainer">
             <div className="toolTitle">Tools in Used</div>
             <div className="imagecontainer">
                 <img src={logo1}/>
             </div>

        </div>
      
           
       
            
              

          
            
      
    );
}

export default Tools;
